import React, { useEffect, useState } from "react";
import { fetchJobs } from "./api";  // your API helper

export default function Dashboard() {
  const [jobs, setJobs] = useState([]);

  useEffect(() => {
    fetchJobs()
      .then(data => setJobs(data))
      .catch(err => console.error("Failed to fetch jobs:", err));
  }, []);

  return (
    <div>
      <h1>Dashboard</h1>
      {jobs.length === 0 ? (
        <p>No matched jobs found.</p>
      ) : (
        jobs.map(job => (
          <div key={job.id} className="job-card">
            <h2>{job.title} - {job.company}</h2>
            <p>Domain: {job.domain}</p>
            <p>Role: {job.role}</p>
            <p>Experience Required: {job.required_experience} yrs</p>
            <p>Location: {job.location}</p>
            <p>Visa Sponsorship: {job.visa_sponsorship}</p>
            <p>Work Mode: {job.work_mode}</p>
          </div>
        ))
      )}
    </div>
  );
}
